import React, { useState } from 'react';
import { useNavigate } from "react-router-dom";


const Game = () => {

    let navigate = useNavigate();
    const goToHome = () => {
        navigate('/Home');
    };

    return (
        <div className="bg-gray-900 flex flex-col items-center h-screen">
            {/* Header section */}
            <div className="w-full text-center pt-3">
                <h1 className="text-white text-3xl font-sans">SWEdle</h1>

                <button className="hover:scale-110 w-32 flex-shrink-0 bg-transparent text-white py-2 px-4 rounded transition duration-300 ease-in-out hover:bg-transparent focus:outline-none" onClick={goToHome}> 
                Home 
                </button>
            </div>

            {/* White line below header */}
            <div className="w-full border-t-4 border-white"></div>

            {/* Additional content */}
            <div className="text-center mt-24 pb-3 w-full">
                    <p className="text-white font-sans">Created by Jonathan Oh</p>
            </div>
        </div>
    );
};

export default Game;
